class Solution:
    def maxOperations(self, s: str) -> int:
        cnt = 0
        ans = 0
        for i in range(len(s)):
            if s[i] == '0':
                continue
            cnt += 1
            if i + 1 < len(s) and s[i + 1] == '0':
                ans += cnt
        return ans
